import React from 'react';
import { dispatch } from 'react-redux'

const Logout = () => {
	const handleSubmit = () => {
		dispatch(logout(email, name))
	}
	return (
		<div>
			<Button>Logout</Button>
		</div>
	)
};
export default Logout;
